import React from "react";
import "./button.styles.scss";
export {ButtonContainer} from './button.styles';

const Button = ({ children, isGoogleSignIn, inverted, ...props }) => (
  <ButtonContainer
    inverted={inverted}
    isGoogleSignIn = {isGoogleSignIn}
    {...props}
  >
    {children}
  </ButtonContainer>
);

export default Button;

